import { useState } from "react";
import MyCart from "./MyCart";

const MyCartProvider = ({ children }) => {
  const [myCartDetails, setMyCartDetails] = useState([]);
  return (
    <MyCart.Provider value={{ myCartDetails, setMyCartDetails }}>
      {children}
    </MyCart.Provider>
  );
};

export default MyCartProvider;
